import { Nav } from 'react-bootstrap'
import { connect } from 'react-redux'
import { Component } from 'react'
import { withRouter } from 'react-router-dom'
import { Props, UserData as State } from '../../interface/Interfaces'
import { mapStateToProps, mapDispatchToProps } from '../../app/functions'



class Sidebar extends Component<Props, State> {

    handlerSide = (e: any) => {
        console.log(e.target.innerHTML)
    }

    render = () => {
        return (
            <div className="listBar">
                <Nav defaultActiveKey="/home" className="flex-column">
                    <Nav.Link onClick={ this.handlerSide } >KK</Nav.Link>
                    <Nav.Link onClick={ this.handlerSide } >KTP</Nav.Link>
                    <Nav.Link onClick={ this.handlerSide } >Staff</Nav.Link>
                    <Nav.Link onClick={ this.handlerSide } >Anggaran</Nav.Link>
                </Nav>
            </div>
        )
    }
}

export default withRouter(connect(mapStateToProps, mapDispatchToProps)(Sidebar))
